function bigSorting(unsorted) {
  let array = [];
  let kuch = unsorted.map((value) => {
    const val = BigInt(value).toString().replace("n", "");
    array.push(val);
  });
  let sorted = array.sort((a, b) => a - b);
  return sorted;
}

